import React from 'react';

import {Router,Route}from "react-router-dom"
import './index.css';




import Register from './routes/Register';
class App extends React.Component{
  render(){
    return(
      <Router>
        <Route path={"register"}Component={Register}/>
      </Router>
    );
  }
}
export default App;
